import { Context } from './../../index';
import { Document } from '../../entities/Document';
import { User } from '../../entities/User';
import { throwError } from '../../../../../shared/errors';

const inviteUsersToDocument = async (_, args, context: Context) => {
  const { id, usersInvited } = args;

  const docRef = await Document.buildFromId(id, context?.user?.id, 'Mutation.inviteUsersToDocument', context);
  if (!docRef) {
    throwError('Mutation.inviteUsersToDocument()', '[Document] Entity not found.');
  }
  const { isSelfInvite } = await docRef.addUsers(usersInvited, context?.user?.id);
  const resolvedDoc = await docRef.resolveAsEntity();

  if (!isSelfInvite) {
    docRef.publishEvent(context.pubsub, 'INVITE');

    // send invite email
    const author = await User.buildFromId(await docRef.get('authorId'), 'Mutation.inviteUsersToDocument', context);
    context.emailManager.triggerInviteEmail({
      documentId: resolvedDoc.id,
      documentName: resolvedDoc.name,
      usersInvited,
      sentBy: await author.get('email'),
      sendTo: usersInvited.map((a) => a.email)
    });
  }

  return resolvedDoc;
};

const addDocument = async (p, args, context) => {
  const { document: newDocument, annotations: annotationInputs, usersInvited } = args;

  const document = await Document.create(newDocument, annotationInputs, usersInvited, 'Mutation.addDocument', context);
  const finalDocument = await document.resolveAsEntity();
  document.publishEvent(context.pubsub, 'ADD');
  return finalDocument;
};

const editDocument = async (p, args, context) => {
  const { id, input } = args;

  const document = await Document.buildFromId(id, context?.user?.id, 'Mutation.editDocument', context);
  if (!document) {
    throwError('Mutation.editDocument()', '[Document] Entity not found.');
  }
  await document.setMultiple(input);
  await document.save(true);
  const newDoc = await document.resolveAsEntity();
  document.publishEvent(context.pubsub, 'EDIT');

  return newDoc;
};

const deleteDocument = async (p, args, context) => {
  const { id } = args;
  const document = await Document.buildFromId(id, context?.user?.id, 'Mutation.deleteDocument', context);
  if (!document) {
    throwError('Mutation.deleteDocument()', '[Document] Entity not found.');
  }
  const deleteResult = await document.delete(true);
  if(deleteResult.successful) {
    document.publishEvent(context.pubsub, 'DELETE');
  }
  return deleteResult;
};

const markAllAsRead = async (p, args, context) => {
  const { documentId } = args;
  const userId = context?.user?.id;
  const document = await Document.buildFromId(documentId, userId, 'Mutation.markAllAsRead', context);
  if (!document) {
    throwError('Mutation.markAllAsRead()', '[Document] Entity not found.');
  }
  const annotations = await document.getCalculated('annotations');
  //update lastRead for all annotations except for imported ones
  await Promise.all(annotations.map(async (annotation) => {
    const authorId = annotation.getEntity().authorId;
    if (authorId) {
      await annotation.markAsRead(userId);
    }
  }));
  await document.publishEvent(context.pubsub, 'EDIT');
  return document.resolveAsEntity();
}

export default { inviteUsersToDocument, addDocument, editDocument, deleteDocument, markAllAsRead };
